// Five favorite adhkar (azkaar) as initial data.
// Each item has a unique id, a phrase, and a count.
export const initialAzkaar = [
  { id: '1', phrase: 'SubḥānAllāh', count: 0 },
  { id: '2', phrase: 'Alḥamdulillāh', count: 0 },
  { id: '3', phrase: 'Allāhu Akbar', count: 0 },
  { id: '4', phrase: 'Lā ilāha illā Allāh', count: 0 },
  { id: '5', phrase: 'Astaghfirullāh', count: 0 },
];
